INSERT INTO `Xnews` VALUES (2,1,0,'Cibo nostro et sea, eu mei alia decore electram, adhuc option corpora vim ad. Sea an eripuit corpora, quas iuvaret maiestatis ad sit, duo ei velit necessitatibus.','<p>It plu plia olda nula, lo ekoo interjekcio a. Iom inkluzive dividostreko sh, subtraho praantahiera bio fo. San go povi triliono kunmetita, anstata supersigno mallongigita iom kz. Tiel ofon iometo dio at, vir alikvante montrovorto prirespondi re, sis tiam reen frazparto jh. Pov mi pobo infra alternativo, nenio geedzo alimaniere sor um.</p>\r\n<p>Tek in dekoj komplika kernovorto, dekuma disskribado je end. Vendo posttagmezo um esk, ki nedifina personalo, unt. Sen ki tiele aligi resti. Diesa resti alikaze enz us, cii gardi duobla vi, ajna ceceo nelimigita oid no. Oho negi antaparto alternativdemando si, adjektivo multiplikite bv ism, ind jh prepozitivo antaelemento. He ano orda nekutima, mil fi alia patro solstariva.</p>\r\n<p>Tia zepto rolvorteto du. Ar duo frota sepen dikfingro. Des vavo senforte ed. Mano halt\' onklo sur nv, aliu help transigi ian o, amen multe kompreneble ena er. Nul tiuj fora nano jo.</p>\r\n<p>Kuo op negi posta. Kazablanko subpropozicio mal ne. End ad ekoo sori, in sor otek finitivo okulvitroj, egalo latina iom ge. Pra ho filo troa, mf esk apud aliel geedzo, fin duobla fratineto sekstiliono as. Lo devus video kelka mia, sia ed mili fini. Sin nula usono kunmetao ik, cii op tiea post gibi, sob brosi substantiva is.</p>\r\n<p>Jam unun participo sh. Nea mo ioma identiga, mi edzo ekde frikativo dio. Cii milo tohuo iufoje tc, mo tet krom prezoinda tempopunkto, hago dank\' esperantigita ok kie. Iufoje helpverbo ko mis, poa ci dura eo komparado. Pli persa deziri ju, falsa ekesti definitive jes aj. Tro iu hodiaa infinitivo, e eca malpli kernovorto.</p>\r\n<p>Ke ato armo postpriskribo. Mem al triliono frikativo miriametro, spite vortfarado fo iel. Oj iom ruli okej vatto. Jota tiama tagnokto nu ili. Nei kian spite ki, nenia reciprokeco ajn vo. Hot jena respondeci uj.</p>\r\n<p>Fri go longa senobjekta postmorga, deci praantahiera ina el, nea ve dato hekto. Ci speco anstatai sat, ses mono literaturo ko. Per vi dume falsa fundamenta, amen siatempe kuo id. Pri vi eo fontoj frazparto. Kab\'o difina lalonge ne a.</p>'),(3,1,0,'Duo voluptua consetetur te, an minimum nominati vix, modo tempor constituto id cum. Eam laudem mentitum definitiones ad. Mel ludus tritani elaboraret ne, voluptua praesent cu sea.','<p>It plu plia olda nula, lo ekoo interjekcio a. Iom inkluzive dividostreko sh, subtraho praantahiera bio fo. San go povi triliono kunmetita, anstata supersigno mallongigita iom kz. Tiel ofon iometo dio at, vir alikvante montrovorto prirespondi re, sis tiam reen frazparto jh. Pov mi pobo infra alternativo, nenio geedzo alimaniere sor um.</p>\r\n<p>Tek in dekoj komplika kernovorto, dekuma disskribado je end. Vendo posttagmezo um esk, ki nedifina personalo, unt. Sen ki tiele aligi resti. Diesa resti alikaze enz us, cii gardi duobla vi, ajna ceceo nelimigita oid no. Oho negi antaparto alternativdemando si, adjektivo multiplikite bv ism, ind jh prepozitivo antaelemento. He ano orda nekutima, mil fi alia patro solstariva.</p>\r\n<p>Tia zepto rolvorteto du. Ar duo frota sepen dikfingro. Des vavo senforte ed. Mano halt\' onklo sur nv, aliu help transigi ian o, amen multe kompreneble ena er. Nul tiuj fora nano jo.</p>\r\n<p>Kuo op negi posta. Kazablanko subpropozicio mal ne. End ad ekoo sori, in sor otek finitivo okulvitroj, egalo latina iom ge. Pra ho filo troa, mf esk apud aliel geedzo, fin duobla fratineto sekstiliono as. Lo devus video kelka mia, sia ed mili fini. Sin nula usono kunmetao ik, cii op tiea post gibi, sob brosi substantiva is.</p>\r\n<p>Jam unun participo sh. Nea mo ioma identiga, mi edzo ekde frikativo dio. Cii milo tohuo iufoje tc, mo tet krom prezoinda tempopunkto, hago dank\' esperantigita ok kie. Iufoje helpverbo ko mis, poa ci dura eo komparado. Pli persa deziri ju, falsa ekesti definitive jes aj. Tro iu hodi